import { v4 as uuidv4 } from 'uuid';

const data = [
  {
    id: uuidv4(),
    image: '../images/image-1.jpg',
    name: 'Shirt',
    desc: 'Lorem ipsum dolor sit amet consectetur adipiscing elit.',
    on_sale: true,
    regular_price: 10,
    actual_price: 10,
    discount_percentage: '12%',
    installments: '3x R$ 39,97',
  },

]

export default data;
